import React, { Component } from 'react';
import Banner from '../../components/Banner'

import './styles.css'

export default class Index extends Component {
	constructor(props) {
		super(props);
	}

	render() {

		return (
			<main>
				<Banner 
					title="Felipe Rocha"
					description='"Criando sites, desenvolvendo sonhos"'
					style="bgImage"
				/>
				<h2>{this.description}</h2>
			</main>
		);
	}
}
